class p2 {
static int x = -55;
public class OQ1 {
	public static void main(String[] args) {
		// TODO Auto-generated method stub
	p2 obj1 = new p2();
		obj1.x = obj1.x*2 - 66;
		System.out.println(obj1.x);
		p2 obj2 = new p2();
		obj2.x = obj2.x+66;
		System.out.println(obj1.x+" "+obj2.x);
	}
	static {
		System.out.println(x);
	}

	
	
}
}


	
